import React, { Component } from 'react'
import './App.css'

class App extends Component {
  constructor() {
    super();

    this.state = {}

    this.showUsers = ""
  }

  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
      .then(res = res.json)
      .then(id => this.setState({id}))
  }

  render() {
    return (
      <div className="App">
        <div>
          <h1>User List</h1>
        </div>
      </div>
    );
  }
}
export default App;
